import React, { useEffect, useState } from 'react';

import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { Link,useNavigate } from 'react-router-dom';

import AddEx from './addEx';


const Create = () => {
    const [type,setType] = useState('Push');
    const [date, setDate] = useState(null);
    const [num,setNum] = useState(1);
    const excersises = new Array(num);
    const[isPending,setIsPending] = useState(false);
    const navigate = useNavigate();

    const [name,setName] = useState([]);
    const [sets,setSets] = useState([]);
    const [reps,setReps] = useState([]);
    const [weight,setWeight] = useState(new Array(num));
        
    
//     useEffect (() = >{
//         e.preventDefault();
//         let x  = num;
//         while(x > 0){
//            excersises[x] = [name[x],weight[x],sets[x],reps[x]];
//            console.log(excersises[x]);
//            x--;
//         } 
// }   );



    const handleSubmit = (e) => {
        e.preventDefault();
        const workout = {type,date,num,excersises};
        setIsPending(true);
        console.log(workout)
        // fetch('http://localhost:8001/workouts',{
        //     method: 'POST',
        //     headers:{"Content-Type": "application/json"},
        //     body:JSON.stringify(workout)
        // }).then(() => {console.log('new workout ');
        //     setIsPending(false);
        //     navigate('/');

        // })
    }

 
    return ( 
        <div className='create'>
            <h2>Add a Workout</h2>  
            <form onSubmit={handleSubmit }>
                <label> Workout Type</label>
                <br />
                    <select
                        required
                        value= {type}
                        onChange={(e) => setType(e.target.value)}>
                        <option value="Push">Push</option>
                        <option value="Pull">Pull</option>
                        <option value="Legs">Legs</option>
                    </select>
                <br />
                <label>Date</label>
                <br />
                    <DatePicker selected={date}
                    onChange={(date) => setDate(date)}
                    required/>

                <br />
                <label>Number of Excersises</label>
                <br />
                    <input 
                    type="number"
                    required
                    value = {num}
                    onChange={(e) => setNum(e.target.value)}/>
                <br />
                <div className='excersises'  >
            
                    <h2>Add your Excersises</h2>  
                    {Array.from({ length: num }, (_, index) => (
                    <div key={index} className='excersise'>
                        <h4>Excersise {index +1}</h4>  

                        <label > Excersise Name</label>
                            <input type="text" 
                            required 
                            value = {name}
                            onChange={(e) => setName(oldArray => [oldArray, e.target.value])} />
                            <br />

                        <label>Weight (lb)</label>
                            <input type="number" 
                            required value={ weight}
                            onChange={(e) => setWeight(oldArray => [oldArray, e.target.value])}/>
                            <br />

                        <label>Sets</label>
                            <input type="number" 
                            required value={ sets}
                            onChange={(e) => setSets(oldArray => [oldArray, e.target.value])}
                            />
                            <br />

                        <label>Reps per Set</label>
                            <input type="number" 
                            required value={ reps}
                            onChange={(e) => setReps(oldArray => [oldArray, e.target.value])}
                            />
                        
                    </div>
                ))}
                </div>
                <br />
                {!isPending && <button >Add Workout</button>}
                {isPending && <button disabled>Adding Workout</button>} 
                    
                
                
               </form>

        </div>
    );
}
 
export default Create;
